    public static double criticalValue(final boolean oneTailed, final int df, final double alpha) {
        if (oneTailed) {
            return criticalValue(oneTailedValues, df, alpha);
        } else {
            return criticalValue(twoTailedValues, df, alpha);
        }
    }

    private static double criticalValue(final List<TwoTuple<Double, double[]>> criticalValues, int df,
            final double alpha) {
        for (final TwoTuple<Double, double[]> tuple : criticalValues) {
            if (tuple.get0() <= alpha) {
                if (df > tuple.get1().length - 1) {
                    df = tuple.get1().length - 1;
                }
                return tuple.get1()[df];
            }
        }
        return Double.MAX_VALUE;
    }
